import { StarOutlined } from '@material-ui/icons';
import React from 'react';
import styled from 'styled-components';
import ClassDisplay from './ClassDisplay';
import CourseDisplay from './CourseDisplay';

function Classes() {
	const classData = ['9', '10', '11', '12', 'pre'];
	const courseData = ['IIT', 'NEET', 'ICSE', 'govt Exam', 'ENGG.'];
	return (
		<Wrapper>
			<ClassItem>
				{classData.map((item) => {
					return <ClassDisplay text={item} />;
				})}
			</ClassItem>
			<Courses>
				{courseData.map((item) => {
					return <CourseDisplay text={item} />;
				})}
			</Courses>
		</Wrapper>
	);
}

export default Classes;

const Wrapper = styled.div`
	display: flex;
	flex-direction: column;
	justify-content: center;
	align-items: center;
`;

const ClassItem = styled.div`
	width: 80%;
	display: flex;
	justify-content: space-around;
	align-items: center;
`;

const Courses = styled.div`
	width: 80%;
	display: flex;
	justify-content: space-around;
	align-items: center;
`;
